import Vue from 'vue'
import VueRouter from 'vue-router'
import Teacherhome from '../components/LJY/Teacherhome.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'Teacherhome',
    component: Teacherhome
  }
]

const router = new VueRouter({
	mode: 'history',
	routes
})

export default router
